script: |
  super -f text -I q1916.spq | sort > q1916.out

inputs:
  - name: q1916.spq
    data: |
      SELECT DISTINCT col0 FROM tab2 (FORMAT parquet) WHERE NOT col2 / + col0 / - col2 - col0 - + col1 + - col1 * col0 * + - 68 * + - col1 * + 51 IS NULL;
  - name: tab2

outputs:
  - name: q1916.out
    data: |
      46
      64
      75
